		oParser = new parserFormula("DOLLAR(1234.567)", "A2", ws);
		assert.ok(oParser.parse());
		assert.strictEqual(oParser.calculate().getValue(), "1 234,57 ₽");

		oParser = new parserFormula("DOLLAR(1234.567,-2)", "A2", ws);
		assert.ok(oParser.parse());
