			var average = 0, res = 0;
			for (var i = 0; i < arguments.length; i++) {
				average += arguments[i];
			}
			average /= arguments.length;
			for (var i = 0; i < arguments.length; i++) {
				res += (arguments[i] - average) * (arguments[i] - average);
			}
			return toFixed(Math.sqrt(res / (arguments.length - 1)));
