		// ws.selectionRange.setActiveCell(ws.getRange2("A10").getBBox0().r1, ws.getRange2("A10").getBBox0().c1);
		ws.getRange2("A10:A110").setValue("=SUM(A2)", null, null, formulaRange.bbox);

